import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const Chevron = styled(FontAwesomeIcon)`
  width: 18px !important;
  display: none;
  padding-left: 1rem;
  font-size: 2.1rem;
`;

export default Chevron;
